PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX ashw: <http://data.ashrae.org/standard223#>
PREFIX brick: <https://brickschema.org/schema/Brick/>

SELECT ?zoneLabel ?propLabel ?alc ?mpc WHERE {
  # Zones
  ?zone a ashw:Zone .
  OPTIONAL { ?zone rdfs:label ?zoneLabel }

  # Non‑writable properties of each zone
  ?zone ashw:hasProperty ?prop .
  ?prop rdfs:label ?propLabel .
  FILTER NOT EXISTS { ?prop brick:writable true }

  # ALC endpoint reference (APIReference external reference)
  OPTIONAL {
    ?prop ashw:hasExternalReference ?ext .
    ?ext a brick:APIReference .
    BIND(?ext AS ?alc)
  }

  # MPC endpoint reference (mpc_db_name)
  OPTIONAL { ?prop brick:mpc_db_name ?mpc }
}
ORDER BY ?zoneLabel ?propLabel

